import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./DogRunPage.css";
import DogrunImage from "../assets/images/Dogrun/dogrun.png";
import Header from "../Header";
import Footer from "../Footer";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation"
import "swiper/css/pagination";



interface Store {
  id: number;
  name: string;
  img: string;
  description: string;
}

const DogRunPage: React.FC = () => {
  const navigate = useNavigate();
  const [stores, setStores] = useState<Store[]>([]);
  const [error, setError] = useState<string | null>(null);

  const handleClick = () => {
    navigate('/DogrunRegionsList');
  };

useEffect(()=> {
  //店舗データを取得
  const fetchStores = async () => {
    try {
      const response = await fetch("http://localhost:5003/stores");
      if(!response.ok) {
        throw new Error("店舗データの取得に失敗しました");
      }
      const data: Store[] = await response.json();
      setStores(data);
    } catch (error) {
      console.error("データ取得エラー:", error);
    }
  };

  fetchStores();
}, []);

useEffect(() => {
  stores.forEach((storeItem) => {
    console.log("取得した店舗情報:", storeItem);
  });
}, [stores]);

  return (
    <>
      <Header />
      <div className="dogrun-page-container">
        <p onClick={handleClick} className="search-dogrun">
          全国のドッグランを探す
        </p>
        <div>
          <img src={DogrunImage} alt="DogrunImage" className="dogrun-image" />
        </div>
        <div className="store-list">
          {stores.map((store) => (
            <div key={store.id} className="store-card">
              <img src={store.img} alt={store.name} className="store-image" />
              <h3>{store.name}</h3>

            </div>
          ))}
        </div>
      </div>

      <Footer/>
    </>

  );
};


export default DogRunPage;
